  true,\n\t\"url\": null,\n\t\"notes\": \"The Office of Nuclear Energya?Ts (NE) primary
  mission is to advance nuclear power as a resource capable of making major contributions
  in meeting our Nationa?Ts energy supply, environmental, and energy security needs.
  We seek to resolve technical, cost, safety, security and regulatory issues through
  research, development and demonstration. By focusing on the development of advanced
  nuclear technologies, NE supports the Administrationa?Ts goals of providing domestic
  sources of secure energy, reducing greenhouse gases, and enhancing national security.rnrnNEa?Ts
  program is guided by the four research objectives detailed in its Nuclear Energy
  Research and Development Roadmap:rna?cDevelop technologies and other solutions that
  can improve the reliability, sustain the safety, and extend the life of current
  reactors.rna?cDevelop improvements in the affordability of new reactors to enable
  nuclear energy to help meet the Administrationa?Ts energy security and climate change
  goals.rna?cDevelop sustainable fuel cycles.rna?cUnderstand and minimize the risks
  of nuclear proliferation and terrorism.rnrnNE serves present and future U.S. energy
  needs by developing critical technologies for the future and helping to train tomorrowa?Ts
  workforce. The benefits of nuclear power as a safe, carbon-free, reliable and secure
  source of energy make it an essential element in our Nationa?Ts energy and environmental
  future.\",\n\t\"license_title\": \"Creative Commons Attribution\",\n\t\"extras\":
